import React from 'react';
import styled from 'styled-components';

import SommWidget from '../components/SommWidget'

const IFrameWrapper = styled.div`
  width: 100vw;
  height: 100%;
  min-height: 100vh;

`;

const XOHDemo = ({}) => (
  <IFrameWrapper>
    <iframe src="https://" frameborder="0"></iframe>
  </IFrameWrapper>
);

export default XOHDemo;
